INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(1, 'ledztwo Onetu w sprawie prezesa PZT. We wtorek kolejne relacje ofiar', , 'politics', 'Napastowanie seksualne oraz wulgarne odzywki, w tym m.in. skierowane do jednej z kelnerek sowa: \"napibym si mleka z twoich cycuszkw, spabym w nich i je ssa\"  jutro w Onecie ujawnimy, w jaki sposb prezes Polskiego Zwizku Tenisowego Mirosaw Skrzypczyski zachowywa si podczas tegorocznego Memoriau im. Lecha i Marii Kaczyskich w Kozerkach.', 3, '2022-11-21');
INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(2, 'Eksperyment Holandii zapewni im zwycistwo. Niespodziewany debiutant gra jak z nut', , 'Football', 'Holendrzy pokonali Senegal 2:0, cho do sensacji byo blisko. Oranje oddali trzy celne strzay, z ktrych dwa znalazy drog do siatki. Eksperyment Louisa van Gaala, ktry w bramce postawi m.in na Andriesa Nopperta, opaci si.\r\n\r\nSenegalczycy z problemami, bo bez Sadio Mane, jednak z najlepsz generacj zawodnikw w historii. Gwiazda Bayernu Monachium nie pojechaa do Kataru, gdy czeka j kilkumiesiczna przerwa z powodu zerwania cigna. Pomimo tego kadra Lww Terangi na papierze wyglda bardzo mocno, a Senegalczycy rywalizuj w najlepszych ligach na wiecie. Polskim kibicom w pamici zapada ich potyczka z Biao-Czerwonymi na mundialu w Rosji. Wtedy gr byli podopieczni Aliou Cisse, jednak ostatecznie zmagania zakoczyli na fazie grupowej. Teraz oczekiwania maj wiksze.', 3, '2022-11-22');
INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(3, 'Marszaek pozbawia PiS wadzy na lsku. \"Nie zgadzam si z tak polityk\"', , 'Politics', 'PiS straci wadz na lsku.  Poziom smrodu przekroczy granic  komentuje w rozmowie z Onetem marszaek wojewdztwa Jakub Chestowski, ktry potwierdza, e wraz z grup radnych opuszcza Prawo i Sprawiedliwo.  Nie ma opcji powrotu. Rezygnuj z czonkostwa w PiS. Cztery lata temu byo przejcie przez PiS wadzy przez transfer Wojciecha Kauy, dzisiaj ja wychodz  dodaje stanowczo.\r\n\r\nW Katowicach trwa sesja Sejmiku lskiego. Atmosfera jest napita, zarzdzono kolejn przerw. Radni z PiS panikuj i szukaj wsparcia w telefonach do Warszawy. Dzi, cztery lata po przejciu Sejmiku przez parti Jarosawa Kaczyskiego, PiS bdzie musiaa odda stery wadzy opozycji. Z PiS egna si marszaek Jakub Chestowski oraz trjka dotychczasowych radnych tej partii.\r\n\r\n', 4, '2022-11-16');
INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(4, 'Cezary Kulesza: potrzebujemy zwyciskiej mentalnoci', , 'Football', ' Zdecydowanie nie bior w ciemno remisu w Meksykiem. Walczymy o pen pul! To jest mundial. Impreza, o ktrej marz wszyscy. eby tu by. Przed telewizorem obejrz go Wosi, Czesi czy Szwedzi. A my tu jestemy. Dlatego teraz chcemy zrobi kolejny krok i wyj z grupy. eby tego dokona potrzebujemy jednak zwyciskiej mentalnoci  mwi Cezary Kulesza w rozmowie z Przegldem Sportowym Onet. Prezes Polskiego Zwizku Piki Nonej przyzna, e zna ju skad na to spotkanie. Nie zabrako take odniesienia si do synnych ju sw Grzegorza Krychowiaka.\r\n\r\nJakie panuj nastroje przed inauguracj mistrzostw wiata w naszym wykonaniu? Odczuwa ju pan dodatkowe emocje?\r\n\r\nFaktycznie pojawia si dodatkowy dreszczyk emocji i troch stresu, natomiast widz, jak ciko pracuje cay zesp. Dlatego zachowuj spokj. Zawodnicy s w peni skupieni, wiadomi swojego celu. Spodziewam si bardzo wyrwnanego starcia z Meksykiem, oczywicie z pozytywnym dla nas zakoczeniem.', 4, '2022-11-16');

